import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './StudentPro.css'; // Make sure to style your profile page as needed

function ProfilePage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { student } = location.state || {};

  const handleReturn = () => {
    navigate('/');
  };

  if (!student) {
    return <div>No student data available.</div>;
  }

  return (
    <div className="profile-container">
      <button onClick={handleReturn} className="return-button">Return to List</button>
      <div className="profile-content">
        <div className="profile-header">
          <h1>{student.studentname}</h1>
        </div>
        <div className="profile-details">
          <p><strong>ID:</strong> {student.studentid}</p>
          <p><strong>Department:</strong> {student.department}</p>
          <p><strong>Section:</strong> {student.section}</p>
          <p><strong>Preferred Degree:</strong> {student.preferreddegree}</p>
          <p><strong>Preferred Course:</strong> {student.preferredcourse}</p>
          <p><strong>Preferred Country:</strong> {student.preferredcountry}</p>
          <div className="scores">
            <h3>Scores:</h3>
            {Object.entries(student.scores || {}).map(([subject, score]) => (
              <p key={subject}><strong>{subject}:</strong> {score}</p>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProfilePage;
